import React from "react";
import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <nav className="nav">
      {/* Brand / Logo */}
      <div className="brand">
        <Link to="/">
          <div className="logo" />
        </Link>
        <div>
          <h1>Chefs2Table</h1>
          <small>Fresh chefs, fresh food</small>
        </div>
      </div>

      {/* Menu links */}
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/chefs">Chefs</Link>
        <Link to="/about">About</Link>
        <Link to="/contact">Contact</Link>

        {/* Temporary dashboard login button */}
        <Link to="/dashboard" className="btn gold">
          Login
        </Link>
      </div>
    </nav>
  );
}
